import React from 'react'

function Student(props) {
    return (
        <tr>
            <td>{props.student.id}</td>
            <td>{props.student.name}</td>
            <td>{props.student.country}</td>
            <td>{props.student.bio}</td>
        </tr>
    )
}

export default Student
